.uptime-day {
	fill: yellow;
}
/*RED*/
.uptime-day[fill="#e74c3c"] {
	fill: red;
}
/*GREEN*/
.uptime-day[fill="#2fcc66"] {
	fill: green;
}



.layout-content.status .shared-partial.uptime-90-days-wrapper .legend .legend-item.light {
	color: white !important;
    opacity: 0.75 !important;
}
.layout-content.status .shared-partial.uptime-90-days-wrapper .legend .legend-item {
	color: white !important;
    opacity: 1 !important;
}


body, .layout-content.status.status-api .section .example-container .example-opener .color-secondary, .grouped-items-selector, .layout-content.status.status-full-history .history-nav a.current, div[id^="subscribe-modal"] .modal-footer, div[id^="subscribe-modal"], div[id^="updates-dropdown"] .updates-dropdown-section, #uptime-tooltip .tooltip-box {
